// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CONTROLSTRUCTURE {

    // ---- Custom error (gas-cheap) ----
    error AfterHours(uint256 time);

    // ---- 1. FizzBuzz – classic rules ----
    function fizzbuzz(uint256 _number) public pure returns (string memory) {
        // 3 AND 5 → FizzBuzz (checked first!)
        if (_number % 3 == 0 && _number % 5 == 0) {
            return "FizzBuzz";
        }
        // 3 → Fizz
        if (_number % 3 == 0) {
            return "Fizz";
        }
        // 5 → Buzz
        if (_number % 5 == 0) {
            return "Buzz";
        }
        // none → Splat
        return "Splat";
    }

    // ---- 2. doNotDisturb – exact spec ----
    function doNotdisturb(uint256 _time) public pure returns (string memory) {
        // ≥ 2400 → **panic** (arithmetic underflow forces a panic error 0x11)
        if (_time >= 2400) {
            uint256 x = 0;
            x = x - 1;          // <-- this underflows → PANIC
        }

        // After-hours: < 800 OR > 2200 → custom error
        if (_time < 800 || _time > 2200) {
            revert AfterHours(_time);
        }

        // Lunch break (12:00 – 12:59)
        if (_time >= 1200 && _time <= 1259) {
            revert("At lunch!");
        }

        // Morning (08:00 – 11:59)
        if (_time >= 800 && _time <= 1199) {
            return "Morning!";
        }

        // Afternoon (13:00 – 17:59)
        if (_time >= 1300 && _time <= 1799) {
            return "Afternoon!";
        }

        // Evening (18:00 – 22:00) – fallback
        return "Evening!";
    }
}

